import React from 'react';
import './Timetable.css'; // Create a CSS file for styling

function Table() {
  return (
    <div className="timetable">
      <div className="row">
        <div className="cell">Day</div>
        <div className="cell">1</div>
        <div className="cell">2</div>
        <div className="cell">3</div>
        <div className="cell break">Break</div>
        <div className="cell">4</div>
        <div className="cell lunch">Lunch</div>
        <div className="cell">5</div>
        <div className="cell">6</div>
        <div className="cell">7</div>
      </div>
      <div className="row">
        <div className="cell">Mon</div>
        {/* Add content for each cell */}
      </div>
      <div className="row">
        <div className="cell">Tue</div>
        {/* Add content for each cell */}
      </div>
      <div className="row">
        <div className="cell">Wed</div>
        {/* Add content for each cell */}
      </div>
      <div className="row">
        <div className="cell">Thu</div>
        {/* Add content for each cell */}
      </div>
      <div className="row">
        <div className="cell">Fri</div>
        {/* Add content for each cell */}
      </div>
      <div className="row">
        <div className="cell">Sat</div>
        {/* Add content for each cell */}
      </div>
      {/* Add more rows for additional days if needed */}
    </div>
  );
}

export default Table;
